import MatchCard from './matchCard';

const FixtureList = (props) => {
        const fixtures = props.fixtures.map(fixture => {
            return <MatchCard image={fixture.homeTeam.logo}/>
        });
    return (
        <div>{fixtures}</div>
     );
}

export default FixtureList;
